import { fromJS } from 'immutable';

const defaultState = fromJS({
	topiclist: [{
		id: 1,
		title: 'news',
		imgUrl: '/src/statics/news'
	}, {
		id: 2,
		title: 'books',
		imgUrl: '/src/statics/book'
	}]
});

export default (state = defaultState, action) => {
	switch(action.type) {

		default :
			return state;
	}
}
